social_posts.post_text:
Man, what a year… In the busiest year of my life y’all listened to my music more than ever and I am GRATEFUL. The reality is, if you music lovers don’t listen, share, add to playlists, buy tickets, like, follow, etc…then we artists don’t have a career. And I’m so grateful for every single listen, on Spotify, Apple, YouTube and everywhere else. It’s the first year I’ve had over a million streams of my music, 800k+ on my album Before You Arrive alone and I’m celebrating y’all!! That’s not including the 500k+ on @hailesyes and my track #ComeThru. I’ll be sharing more about some of my favorite songs this month but I also want to take this opportunity to thank every collaborator, musician, producer, songwriter, vocalist, mixing or mastering engineer that helped bring all this music to life. And to my wife @elainewelteroth, thank you for being a fan of my music and supporting my pursuit of this passion even through pregnancy, childbirth, home renovations, and the crazy year we’ve had. Forever grateful. 

And thank you all:
